                title: 'Cuando tengas hambre',
                text: 'prepara unos garbanzos al horno'
            }
        ]
    },
    {
        id: uuid(),
        title: 'En proceso',
        cards: [
            {
                id: uuid(),
                title: 'Estudio',
                text: 'ver videos de react y practicar'
            },
            {
                id: uuid(),
                title: 'Leer',
                text: 'Leyendo libro de Cortázar'
            }
        ]
    }
]

